import React from "react";
import PropTypes from "prop-types";

const NewDraft = ({ title }) => <div></div>;

NewDraft.propTypes = {
  /**
   * The component's title.
   */
  title: PropTypes.string
};

NewDraft.defaultProps = {
  title: "New Draft"
};

export default NewDraft;
